-- Banco local --

CREATE TABLE analiseDados (
  idLeitura int NOT NULL auto_increment,
  idServidor int,
  usoCpu int NOT NULL,
  usoRam int NOT NULL,
  usoDisco int NOT NULL,
  dia date,
  PRIMARY KEY (idLeitura)
) AUTO_INCREMENT=1;

-- Azure --

CREATE TABLE analiseDados (
  idLeitura int PRIMARY KEY IDENTITY(1,1),
  idServidor int,
  usoCpu int NOT NULL,
  usoRam int NOT NULL,
  usoDisco int NOT NULL,
  dia date,
  PRIMARY KEY (idLeitura)
);

